int order(char c) {
    if (c == '+')
        return 62;
    if (c == '/')
        return 63;
    if (isdigit(c))
        return c - '0';
    if (islower(c))
        return 10 + c - 'a';
    if (isupper(c))
        return 36 + c - 'A';
    assert(false);
}

void init_edge_table() {
    int val = 0;
    int idx = 0;
    for (char c : encoded_table) {
        if (c == '|') {
            edge_table[idx] = values[val];
            edge_table[idx + 1] = values[val];
            edge_table[idx + 2] = values[val];
            idx += 3;
            val = 0;
        }
        else if (c == ','){
            edge_table[idx] = values[val];
            idx++;
            val = 0;
        }
        else {
            val *= 64;
            val += order(c);
        }
    }
    if (idx < 59049)
        edge_table[idx] = values[val];
}